import React from 'react'
import logo from '../mySource/favicon.ico'
import main from '../mySource/logo.svg'
import styled from 'styled-components'
const Landing = () => {
  return (
    <Wrapper>
    <main>
      <nav>
        <img src={logo} alt='123' style={{}} className = 'logo'></img>
      </nav>
    </main>
    </Wrapper>
  )
}
const Wrapper = styled.main`
nav {
  width: var (--fluid-width);
  max-width: var (--max-width);
  margin: 0 auto;
  height: var(--nav-height);
  display: flex;
  align-item: center;
}
`

export default Landing
